export const Data = {
    menus: [{
            header: true,
            name: 'Dashboard'
        },
        {
            name: 'Dashboard',
            icon: 'fas fa-fire',
            url: '/dashboard/general',
        },
        {
            header: true,
            name: 'Transactions'
        },
        {
            name: 'Add New Transaction',
            icon: 'far fa-square',
            url: "/add"

        },
        {
            name: 'View Transactions',
            icon: 'fas fa-th',
            url: "/view"

        },
        {
            header: true,
            name: 'Friends'
        },
        {
            name: 'Add New Friend',
            icon: 'fas fa-th-large',
            url: "/add_friend"
        },
        {
            name: 'My Friends',
            icon: 'fas fa-th-large',
            url: "/friends"
        },

        {
            dropdown: true,
            active: false,
            name: 'Utilities',
            icon: 'fas fa-ellipsis-h',
            children: [{
                    name: 'Contact',
                    url: '/utilities/contact',
                    active: false
                },
                {
                    name: 'Invoice',
                    url: '/utilitie/Invoice',
                    active: false
                },
                {
                    name: 'Subscribe',
                    url: '/utilities/subscribe',
                    active: false
                }
            ]
        },
        {
            dropdown: false,
            active: false,
            name: 'Credits',
            icon: 'fas fa-pencil-ruler',
            url: '/credit',
        }
    ]
};
